// Error custom -- 8.0版本新增功能
contract Errors {
    uint public num = 123;

    function testRequire (uint x) external pure {
        require (x <= 10, "x > 10");
    }

    function testRevert (uint x) external pure {
        if (x <= 10) {
            revert ("i > 10");
        }
    }

    function testAssert () external view {
        assert(num == 123);
    }

    function foo (uint x) external {
        num += x;
        require (x <= 10);
    }

}

